import { makeStyles } from '@material-ui/core/styles';

import { colors } from './common';

const useStyles = makeStyles({
    supportBox: {
        borderRadius: ".3em",
        backgroundColor: colors.secondary,
        color: colors.white,
        padding: ".25em",
        marginTop: "1.3em",
        margin: "1em 0 1em 0 ",
    },
    supportLink: {
        color: colors.white,
        textDecoration: "none",
    },
});

function HomeSupportLinks() {
    const classes = useStyles();

    const sideBarData = [
        { title: "Review Us! Google",    link: "#" },
        { title: "Review Us! Yelp",      link: "#" },
        { title: "Follow Us! Instagram", link: "#" },
        { title: "Like Us! Facebook",    link: "#" },
    ];

    return ( sideBarData.map((support) =>
        <div className={classes.supportBox}>
            <h2><a className={classes.supportLink} href={support.link}>{support.title}</a></h2>
        </div>
    ));
}

export default HomeSupportLinks;
